let's summarize the fix:

before: a miner with a large number of keys collected a conversation using line overlay (which is absolutely not needed according to the subnet task). and collect several conversations from different validators at once. 

Now: the same thing, just different conversations will also be from one validator at the same time. what is the fix? why line overlay? remove line overlay and the fix will be perfect. or take not the first 5 windows, but random 5 from the conversation (there will be practically no intersection)

